import React, { useState } from "react";
import axios from "axios";
import {
  Box,
  Container,
  IconButton,
  InputAdornment,
  Stack,
  TextField,
  Typography,
} from "@mui/material";
import { Form, FormikProvider, useFormik } from "formik";
import * as Yup from "yup";
import VisibilityIcon from "@mui/icons-material/Visibility";
import VisibilityOffIcon from "@mui/icons-material/VisibilityOff";
import { useDispatch } from "react-redux";
import { useNavigate } from "react-router-dom";
import { LoadingButton } from "@mui/lab";
import { Link } from "react-router-dom";
import { toast } from "react-toastify";
import storage from "../lib/localStorage";
import { authenticateUser } from "../store/slices/user/UserThunk";
import { setAuthenticate, setUser } from "../store/slices/user/UserSlice";

const Register = () => {
  const [showPassword, setShowPassword] = useState(false);
  const RegisterSchema = Yup.object().shape({
    firstName: Yup.string()
      .min(2, "Too Short!")
      .max(50, "Too Long!")
      .required("First name required"),
    lastName: Yup.string()
      .min(2, "Too Short!")
      .max(50, "Too Long!")
      .required("Last name required"),
    email: Yup.string()
      .email("Email must be a valid email address")
      .required("Email is required"),
    password: Yup.string()
      .required("Password is required")
      .min(8, "Too Short!")
      .matches(
        /^(?=.*[a-z])(?=.*[A-Z])(?=.*\d)(?=.*[!@#$%^&*()])/,
        "Password must contain at least one lowercase letter, one uppercase letter, one number, and one symbol"
      ),
    passwordConfirmation: Yup.string().oneOf(
      [Yup.ref("password"), null],

      "Passwords must match"
    ),

    securityAnswer: Yup.string().required("securityAnswer is required"),
  });

  const dispatch = useDispatch();

  const navigate = useNavigate();

  const [fName, setFName] = useState("");

  const [lName, setLName] = useState("");

  const [email, setEmail] = useState("");

  const [password, setPassword] = useState("");

  const [security_qs, setSecurity_qs] = useState("");

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      // Send registration data to backend

      const response = await axios.post("http://localhost:9012/user/register", {
        fName,

        lName,

        email,

        password,

        security_qs,
      });

      // Registration successful

      console.log(response.data);

      navigate("/login");
    } catch (error) {
      // Handle registration error

      console.error(error);
    }
  };

  const formik = useFormik({
    initialValues: {
      firstName: "",

      lastName: "",

      email: "",

      password: "",

      passwordConfirmation: "",

      securityAnswer: "",
    },

    validationSchema: RegisterSchema,

    onSubmit: async (values) => {
      const { email, password, firstName, lastName, securityAnswer } = values;

      //console.log(values);

      dispatch(
        authenticateUser({
          email,

          password,
        })
      )
        .then((response) => {
          const { payload } = response;

          console.log(payload);

          if (!payload) {
            toast.error("Something went wrong! Try again later");

            return;
          }

          if (payload["status"] !== "SUCCESS") {
            toast.error(payload["message"]);

            return;
          }

          const data = payload["data"];

          storage.put("token", data);

          dispatch(setUser(data));

          navigate("/login");
        })
        .catch((error) => {
          console.log(error);
        });
    },
  });

  const { errors, touched, isSubmitting, handlSubmit, getFieldProps } = formik;

  return (
    <Container maxWidth="sm" sx={{ height: "100%" }}>
      <Box sx={{ mt: 20 }}>
        <Stack spacing={5}>
          <Box>
            <Typography
              variant="h3"
              sx={{
                textAlign: "center",
              }}
            >
              Register
            </Typography>
          </Box>

          <FormikProvider value={formik}>
            <Form autoComplete="off" noValidate onSubmit={handleSubmit}>
              <Stack spacing={3}>
                <TextField
                  fullWidth
                  label="First name"
                  value={fName}
                  onChange={(e) => setFName(e.target.value)}
                  // {...getFieldProps("firstName")}

                  error={Boolean(touched.firstName && errors.firstName)}
                  helperText={touched.firstName && errors.firstName}
                />

                <TextField
                  fullWidth
                  label="Last name"
                  value={lName}
                  onChange={(e) => setLName(e.target.value)}
                  // {...getFieldProps("lastName")}

                  error={Boolean(touched.lastName && errors.lastName)}
                  helperText={touched.lastName && errors.lastName}
                />

                <TextField
                  fullWidth
                  label="Email"
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                  // {...getFieldProps("email")}

                  error={Boolean(touched.email && errors.email)}
                  helperText={touched.email && errors.email}
                />

                <TextField
                  fullWidth
                  type="password"
                  label="Password"
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                  //{...getFieldProps("password")}

                  error={Boolean(touched.password && errors.password)}
                  helperText={touched.password && errors.password}
                />

                <TextField
                  fullWidth
                  type={showPassword ? "text" : "password"}
                  label="Confirm Password"
                  // {...getFieldProps("passwordConfirmation")}

                  InputProps={{
                    endAdornment: (
                      <InputAdornment position="end">
                        <IconButton
                          edge="end"
                          onClick={() => setShowPassword((prev) => !prev)}
                        >
                          {showPassword ? (
                            <VisibilityIcon />
                          ) : (
                            <VisibilityOffIcon />
                          )}
                        </IconButton>
                      </InputAdornment>
                    ),
                  }}
                  error={Boolean(
                    touched.passwordConfirmation && errors.passwordConfirmation
                  )}
                  helperText={
                    touched.passwordConfirmation && errors.passwordConfirmation
                  }
                />

                <TextField
                  fullWidth
                  label="Security Question: What is the name of your first pet? "
                  value={security_qs}
                  onChange={(e) => setSecurity_qs(e.target.value)}
                  // {...getFieldProps("securityAnswer")}

                  error={Boolean(
                    touched.securityAnswer && errors.securityAnswer
                  )}
                  helperText={touched.securityAnswer && errors.securityAnswer}
                />

                <LoadingButton
                  loading={isSubmitting}
                  fullWidth
                  variants="contained"
                  type="submit"
                >
                  Submit
                </LoadingButton>
              </Stack>
            </Form>
          </FormikProvider>
        </Stack>

        <p>
          <Link component={Link} to="/update-password">
            Reset Password
          </Link>
        </p>

        <p>
          Already registered? <Link to="/login">Log in</Link>
        </p>
      </Box>
    </Container>
  );
};

export default Register;
